The sizzling saga of a wide open marriage

What happens when the pursuit of hedonistic sensuality blazes out of control? Find out when you experience the intimate indiscretions of Dan and Lisa, a married couple who take sex to the limit and love to disaster in Never Sleep Alone. 

From the forbidden carnality of notorious underground sex clubs to New York's most private penthouses, Dan and Lisa taste every insatiable pleasure and torrid sex act ever conceived. Along with sex superstars Honey Wilder, Joanna Storm and Joey Silvera, every second of this arousing piece of erotica burns with nonstop sex. Soon you'll discover what happens when you Never Sleep Alone. For some people, it's always an easy rule to follow.
